import React from 'react'
import Styles from './NavBtn.module.css'
import { Link } from 'react-router'


const NavBtn = (props) => {
    const foo =(e)=>{
        console.log(foo);
        
        props.cM(e.target.value)
    }
    return (
        <li className={Styles.navBtn}>
        <Link className={Styles.text}
            to={"/"+props.name}
            onClick={foo}>
            {props.name}
        </Link>
            
              
            
          
        </li>
    )
}
export default NavBtn
